import { Component, EnvironmentInjector, inject } from '@angular/core';
import { IonTabs, IonTabBar, IonTabButton, IonIcon, IonLabel } from '@ionic/angular/standalone';
import { addIcons } from 'ionicons';
import { clipboardOutline, peopleCircle, triangle, ellipse, square, rocket } from 'ionicons/icons';

@Component({
  selector: 'app-tabs',
  templateUrl: 'tabs.page.html',
  styleUrls: ['tabs.page.scss'],
  standalone: true,
  imports: [IonTabs, IonTabBar, IonTabButton, IonIcon, IonLabel],
})
export class TabsPage {
  public environmentInjector = inject(EnvironmentInjector);

  constructor() {
    addIcons({rocket,clipboardOutline,peopleCircle,triangle,ellipse,square});
  }
}
<ion-tabs>
  <ion-tab-bar slot="bottom">
    <ion-tab-button tab="tab1" href="/tabs/tab1">
      <ion-icon name="rocket" aria-hidden="true"></ion-icon>
      <ion-label>Teachable Machine</ion-label>
    </ion-tab-button>

    <ion-tab-button tab="tab2" href="/tabs/tab2">
      <ion-icon name="clipboard-outline"></ion-icon>
      <ion-label>Opinión</ion-label>
    </ion-tab-button>

    <ion-tab-button tab="tab3" href="/tabs/tab3">
      <ion-icon aria-hidden="true" name="people-circle"></ion-icon>
      <ion-label>Acerca de</ion-label>
    </ion-tab-button>
  </ion-tab-bar>
</ion-tabs>
